import { useParams } from "react-router-dom";

interface Hospital {
  store_id: number;
  store_name: string;
  store_description: string;
  store_address: string;
  store_phone: number;
  store_url: string;
  store_img: string;
}

interface HospitalTag {
  id: number;
  name: string;
}

const HospitalList: React.FC = () => {
  const { prefectureId } = useParams<{ prefectureId: string }>(); // URLのパラメータから都道府県IDを取得する
  const [ hospitalList, setHospitalList  ] = useState<Hospital[]>([]); // 病院リストの状態を定義する
  const [ hostpitalTags, setHospitalTags ] = useState<HospitalTag[]>([]); //タグ情報の状態を定義する

;}



export default HospitalList;
